        public void EnableNoTSSDataMessage(int NumberNoTSSDataIntervals)
        {
            txtNoTSSData.Text = "No TSS data was received for the last " + NumberNoTSSDataIntervals + " intervals.";
            txtNoTSSData.Visible = true;
        }
        public void DisableNoTSSDataMessage()
        {
            txtNoTSSData.Text = string.Empty;
            txtNoTSSData.Visible = false;
        }

        public void EnableNoCVDataMessage(int NumberNoCVDataIntervals)
        {
            txtNoCVData.Text = "No CV data was received for the last " + NumberNoCVDataIntervals + " intervals.";
            txtNoCVData.Visible = true;
        }
        public void DisableNoCVDataMessage()
        {
            txtNoCVData.Text = string.Empty;
            txtNoCVData.Visible = false;
        }

        public void EnableNoTroupingMessage(double MMRecurringCongestion)
        {
            txtNoTrouping.Text = "No Queued or Congested sublinks were detected upstream of the recurring congestion location at MM " + MMRecurringCongestion;
            txtNoTrouping.Visible = true;
        }
        public void DisableNoTroupingMessage()
        {
            txtNoTrouping.Text = string.Empty;
            txtNoTrouping.Visible = false;
        }

        public void EnableNoSpdHarmMessage(double MMRecurringCongestion)
        {
            txtNoSpdHarm.Text = "No Queued or Congested sublinks were detected upstream of the recurring congestion location at MM " + MMRecurringCongestion;
            txtNoSpdHarm.Visible = true;
        }
        public void DisableNoSpdHarmMessage()
        {
            txtNoSpdHarm.Text = string.Empty;
            txtNoSpdHarm.Visible = false;
        }

